import "./Container.css";
import Button_1 from "./Button_1.js";
import "./Button_1.css";
import PhotoZone from "./PhotoZone.js";
import Card1 from "./Card1.js";
import BlueArrow from "./BlueArrow.js";
import Card2 from "./Card2.js";
import portfolioContent from "../Data/data.js";
import LetsWork from "./LetsWork/LetsWork.js";
import FB_VK from "./FB_VK/FB_VK.js";
import { useContext } from "react";
import { ThemeContext } from "../App.js";
import "../App.css";
import { createContext, useState } from "react";
const btn_theme = createContext(null);

function Container(props) {
  const i = props.i;
  const sc = props.sc;
  const currentTheme = useContext(ThemeContext);

  function handleClick_1() {
    if (currentTheme.theme === "dark") {
      currentTheme.setTheme("light");
    } else {
      currentTheme.setTheme("dark");
    }
  }
  /*
  return (
    <ThemeContext.Provider value={{ theme, setTheme }}>
      <div className={`${theme}`}>
        <Container i={i} sc={sc} />
      </div>
    </ThemeContext.Provider>
  );
*/
  return (
    <btn_theme.Provider>
      <div className="  Container  ${theme} ">
        <header id="1">
          <div className="spacing0"></div>
          <div className="navMenu1">
            <div className="Denis   ${theme}   ">Denis</div>
            <div className="buttons1">
              <Button_1 innerText={"About me"} theme={currentTheme.theme} />
              <Button_1 innerText={"PortFolio"} theme={currentTheme.theme} />
              <Button_1 innerText={"Contact me"} theme={currentTheme.theme} />
            </div>
            <div
              onClick={() => {
                handleClick_1();
              }}
            >
              <Button_1 innerText={`${currentTheme.theme} theme`} />
            </div>
          </div>
          <div className="Wrapper_1">
            <div className="Stunning_Programmer_Wrapper ${theme}    ">
              <div className="Stunning_Programmer  ${theme}     ">
                Frontend Developer
              </div>

              <div className="Denis_Chigvintsev1     ${theme}         ">
                Denis Chigvintsev
              </div>
            </div>
            <div className="central_1"></div>
            <LetsWork />
          </div>
          <div className="divider1     ${theme}  "></div>
        </header>
        <main>
          <section>
            <div>
              <PhotoZone />
            </div>
          </section>
          <div className="spacing1"></div>
          <section>
            <Card1 theme={currentTheme.theme} />
          </section>

          <section>
            <Card2
              title={portfolioContent[i].title}
              scope={portfolioContent[i].scope}
              url={portfolioContent[i].url}
              i={i}
              sc={sc}
            />
          </section>
        </main>
        <div className="divider1 divider2"></div>
        <footer>
          <div className="footer">
            <div>
              <LetsWork />
            </div>
            <div>
              <div className="Denis_Chigvintsev1">Denis Chigvintsev</div>
              <div className="footer_fb">
                <FB_VK />
              </div>
            </div>
          </div>

          <div className="divider1 divider3"></div>
          <div className="cr   ${theme}        ">&copy; 2024</div>
        </footer>
      </div>
    </btn_theme.Provider>
  );
}

export default Container;
